INSERT INTO `lv_faqs` (`id`, `category_id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 4, 'Kann ich meine Bestellung im Nachhinein bearbeiten?', '<p>Solltest du dich bei der Bestellung verschrieben haben, er√∂ffne bitte direkt ein Ticket. Sollte das Ticket vor Versand bearbeitet werden, k√∂nnen wir die Bestellung bearbeiten. Jedoch geben wir hierf√ºr keine Garantie.</p>', '2021-01-15 13:41:23', '2022-03-02 11:21:36'),
(3, 3, 'Wann werden die Tickets bearbeitet?', '<p>Unser Support-Team ist bem√ºht mindestens 3 mal t√§glich die Tickets zu bearbeiten.</p>', '2021-01-15 13:42:12', '2022-03-02 11:19:45'),
(4, 4, 'Wann werden die Pakete eingeliefert?', '<p>Der Bestellschluss ist jeden Tag ab 17:30 Uhr, danach werden die Pakete verpackt und versendet.</p><p>Wir versenden von Mo. - Sa. <br>Von 17:30 bis sp√§testens 23:00.</p><p>&nbsp;Filialeinlieferung sind an Feiertagen nicht m√∂glich.</p>', '2021-01-15 13:42:33', '2022-09-07 14:12:40'),
(5, 4, 'Wie lange ist meine TID durchschnittlich unterwegs?', '<p>Die Pakete sind ca. 1,5. - 3 Wochen unterwegs.</p>', '2021-01-15 13:42:54', '2022-03-02 11:18:17'),
(6, 4, 'Was wenn meine 80% TID doch zugestellt wird?', '<p>Sollte es dazu kommen, dass eine 80% TID doch mal zugestellt wird, gibt es, f√ºr Stammkunden sofern der Fehler bei der DHL lag aus Kulanz eine Erstattung des Kaufpreises in Form von Guthaben.</p><p>Neukunden erhalten lediglich eine Erstattung, sollte der Fehler auf unserer Seite liegen.</p><p>Die Zustellung einer 80% TID kann bspw. passieren, wenn der Postbote den Empf√§nger pers√∂nlich kennt, der Empf√§nger selbst bei der Post arbeitet oder das DHL System die Person an der richtigen Adresse ermitteln kann. Gerade in kleinen St√§dten passiert das h√§ufiger.</p><p>F√ºr falsch √úbermittelte Daten haften wir nicht.</p>', '2021-01-25 15:48:15', '2022-03-10 11:39:04'),
(7, 4, 'Meine Trackingnummer wurde nicht aktualisiert, wurde das Paket eingeliefert?', '<p>Falls Probleme zu deiner Sendung auftreten sollten, er√∂ffne bitte ein Ticket.</p>', '2021-01-25 15:52:45', '2022-04-04 10:51:23'),
(9, 3, 'Meine Einzahlung wurde nicht automatisch gutgeschrieben?', '<p>Gib dem System bitte etwas Zeit um deine Einzahlung zu best√§tigen, sollte es nicht automatisch gehen, er√∂ffne ein Ticket.</p>', '2021-09-27 11:40:42', '2022-04-04 10:48:02'),
(10, 5, 'Was ist fake-tids.su?', '<p>Hierbei handelt es sich um einen Paket-Versand Service an eine Wunschadresse. Wir distanzieren uns von jeglichen Kriminellen Handlungen.</p>', '2022-03-02 11:23:08', '2022-04-04 10:49:55'),
(11, 6, 'Wann bekomme ich einen Replace?', '<p>- Im Falle eines Replaces erfolgt ausschlie√ülich eine Gutschrift in unserem Shop.</p><p>Generell gilt, dass Replace Video ist nur g√ºltig wenn folgende Kriterien erf√ºllt werden:</p><p>- die aktuelle Systemzeit sowie die URL unseres Stores bzw den Kauf auf unserer Seite zeigt,</p><p>- vor dem Erhalt der Ware aufgenommen undungeschnitten ist.</p><p>- Keine Handy Aufnahmen erlaubt.</p><p>Wir empfehlen f√ºr den Upload bei einem Replace Anspruch streamable.com!</p><p>Bitte versteht das aufgrund von Kulanzmissbrauch kein Replace ohne Video m√∂glich ist.</p><p><br></p>', '2022-04-10 16:27:06', '2022-04-16 10:28:24'),
(13, 4, 'Firmen-Name als Empf√§nger', '<p>Wir hatten nun leider vermehrt das Problem das TIDs mit Firmen-Namen zugestellt wurden. Da DHL in diesem Fall bessere technische M√∂glichkeiten hat den Original Empf√§nger zu lokalisieren.<br>Ihr solltet in diesem Fall LITs (Lost in Transit) kaufen.<br><br></p>', '2022-04-14 11:20:15', '2022-04-16 16:22:18'),
(14, 7, 'Wie lange dauert es bis mein Paket verschwunden geht?', '<p>Das Paket geht innerhalb der ersten 48h verschwunden.</p>', '2022-04-16 14:15:13', '2022-04-16 14:15:13'),
(15, 7, 'Wie lange dauert es bis ich einen Refund erhalte?', '<p>Leider k√∂nnen wir hierzu keine Angaben machen, da jeder Shop unterschiedlich ist. Im Normalfall aber 14 Tage.</p>', '2022-04-16 14:15:52', '2022-04-16 14:15:52'),
(16, 3, 'Kann ich Guthaben auszahlen lassen?', '<p>Guthaben kann nicht ausgezahlt werden.</p>', '2022-06-11 09:38:53', '2022-06-11 09:38:53');
